import React, { Fragment } from 'react'

const SectionLeft = (props) => {
  return (
    <Fragment>
        {props.links.map(link => {
          return <div className="nav-menu-item-first">
            <a href={"#" + link.name + "-" + link.name2}><span className="text">{link.name + " " + link.name2}</span></a>
            <span className="line -bottom"></span>
          </div>
        })}
      {props.blabla.map(bla => {
        return <Fragment>
        <h2 className="title-bold">bla.title</h2>
          <h3 className="featured-item-subheader italic">bla.subtitle</h3>
        <p className="featured-item-body">bla.text</p>
        </Fragment>
      })}
    </Fragment>
  )
}

export default SectionLeft;
